import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography, Box } from '@mui/material';

const ProductList = ({ products, onDelete, onScrape }) => {
  
    return (
      <Box>
        {products.map((product) => (
          <Box key={product.id} mb={2} border="1px solid #ccc" borderRadius={2} p={2}>
            <Typography variant="h6">{product.name}</Typography>
            <Button onClick={() => onDelete(product.id)} color="error">Delete</Button>
            <Button onClick={() => onScrape(product.id)} sx={{ ml: 1 }}>Scrape</Button>
          </Box>
        ))}
  
      </Box>
    );
};

export default ProductList;
